import React, { Component } from "react";
import "./static/css/bootstrap.min.css";
import "./static/css/style.css";
import Start from "./pages/Start";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Start />
      </div>
    );
  }
}

export default App;
